import React, { useState } from 'react';
import axios from 'axios';
import { useTable, useExpanded } from 'react-table';

const ClientePesquisa = () => {
  const [nomeCliente, setNomeCliente] = useState('');
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const pesquisarCliente = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`http://localhost:3333/findClienteByName?name=${nomeCliente}`);
      setData(response.data);
      setError(null);
    } catch (error) {
      setError(error);
      setData(null);
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (event) => {
    setNomeCliente(event.target.value);
  };

  const columns = React.useMemo(
    () => [
      {
        Header: 'Nome do Cliente',
        accessor: 'nomeCliente',
      },
      {
        Header: 'Ações',
        Cell: ({ row }) => (
          <span {...row.getToggleRowExpandedProps()}>
            {row.isExpanded ? 'Ocultar Detalhes' : 'Mostrar Detalhes'}
          </span>
        ),
      },
    ],
    []
  );

  const renderRowSubComponent = React.useCallback(
    ({ row }) => (
      <div style={{ padding: '10px' }}>
        <p>Status: {row.original.statusCliente}</p>
        <p>IP Concentrador: {row.original.ipConcentrador}</p>
        <p>Nome Concentrador: {row.original.nomeConcentrador}</p>
        <p>Latitude: {row.original.latitudeCliente}</p>
        <p>Longitude: {row.original.longitudeCliente}</p>
        <p>Conexão Inicial: {row.original.conexaoInicial}</p>
        <p>Conexão Final: {row.original.conexaoFinal}</p>
        <p>Tempo Conectado: {row.original.tempoConectado}</p>
        <p>Consumo Download: {row.original.consumoDownload}</p>
        <p>Consumo Upload: {row.original.consumoUpload}</p>
        <p>Motivo Desconexão: {row.original.motivoDesconexao}</p>
        <p>POP Cliente: {row.original.popCliente}</p>
        <p>Endereço: {row.original.enderecoCliente}</p>
        <p>Bairro: {row.original.bairroCliente}</p>
        <p>Cidade: {row.original.cidadeCliente}</p>
        <p>Plano Contrato: {row.original.planoContrato}</p>
        <p>Status Internet: {row.original.statusInternet}</p>
        <p>Valor Plano: {row.original.valorPlano}</p>
      </div>
    ),
    []
  );

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
  } = useTable(
    {
      columns,
      data: data || [],
    },
    useExpanded
  );

  return (
    <div>
      <h1>Pesquisar Cliente</h1>
      <label>
        <span>Informe o nome do cliente: </span>
        <input value={nomeCliente} onChange={handleInputChange} name="myInput" />
      </label>
      <button onClick={pesquisarCliente}>
        Pesquisar
      </button>
      {loading && <p>Loading...</p>}
      {error && <p>Error: {error.message}</p>}
      {data && (
        <table {...getTableProps()} style={{ border: 'solid 1px blue' }}>
          <thead>
            {headerGroups.map(headerGroup => (
              <tr {...headerGroup.getHeaderGroupProps()}>
                {headerGroup.headers.map(column => (
                  <th {...column.getHeaderProps()} style={{ borderBottom: 'solid 3px red', background: 'aliceblue', color: 'black', fontWeight: 'bold' }}>
                    {column.render('Header')}
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody {...getTableBodyProps()}>
            {rows.map(row => {
              prepareRow(row);
              return (
                <React.Fragment key={row.id}>
                  <tr {...row.getRowProps()}>
                    {row.cells.map(cell => (
                      <td {...cell.getCellProps()} style={{ padding: '10px', border: 'solid 1px gray', background: 'papayawhip' }}>
                        {cell.render('Cell')}
                      </td>
                    ))}
                  </tr>
                  {row.isExpanded ? (
                    <tr>
                      <td colSpan={2}>
                        {renderRowSubComponent({ row })}
                      </td>
                    </tr>
                  ) : null}
                </React.Fragment>
              );
            })}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default ClientePesquisa;
